import React, { Component } from 'react';

import Cell from '../Cell';

import * as C from './style';

class Container extends Component {
  render() {
    return (
      <C.Wrapper {...this.props}>
        <Cell />
        <Cell />
        <Cell />
        <Cell />
      </C.Wrapper>
    );
  }
}

export default Container;
